import reducer, { initialState } from './Util/reducer';
import CryptoContext from './Util/CryptoContext';


ReactDOM.render(
  <React.StrictMode>
    {/* <StateProvider initialState={initialState} reducer={reducer}> */}
    <CryptoContext>
    <App />
    </CryptoContext>

    {/* </StateProvider> */}
  </React.StrictMode>,
  document.getElementById('root')
);

